import React from 'react'

function ContactUs(){

    return (
      <div
        style={{
          color: "black",
          backgroundColor: "rgba(255,255,255, 0.8)",
          padding: "10px",
          marginTop: "20px",
        }}
      >
        <h2>Contact Us</h2>
        <p>
          We value your feedback and are here to assist you. Reach out to us
          using the contact details provided below or fill out the contact form,
          and we'll get back to you as soon as possible.
        </p>

        <h5>Contact Information:</h5>
        <ul>
          <li>Email: info@codemaster.com</li>
          <li>Phone: +1 123-456-7890</li>
          <li>Address: 123 Coding Street, City, Country</li>
        </ul>
      </div>
    );
}

export default ContactUs;
